import React, { Component } from 'react'
import '../../index.css'
import { MDBContainer } from "mdbreact";
import FormPage from '../functional/SignUpForm'

class SignUp extends Component {
    render() {
        return (
            <MDBContainer>
                <FormPage />
            </MDBContainer>
        )
    }
}

export default SignUp;
